syntax/generator-function/generator-is-a.body:
ERROR: Generator is already running
与之关联的另一种报错是：
TypeError: Iterator result undefined is not an object
问题解读
这是 v6.9.1 版本在和谐模式下运行时出现的一个现象。来看源代码
// foo.js
&#39;use strict&#39;;

function foo() {
    console.log(&#39;foo invoked&#39;);
}

var G = function*() {
    // KEY LINE
    return foo();
}

var gen = G();
console.log(gen.next());

try {
    gen.next();
} catch(ex) {
    console.log(&#39;[ERROR] &#39; + ex.message);
}

普通模式下执行上述程序的输出如下：
node foo.js
# OUTPUT
# foo invoked
# { value: undefined, done: true }
# { value: undefined, done: true }

但是打开 --harmony 开关后，问题出现了：
node -v
# OUTPUT:
# v6.9.1

node --harmony foo.js
# OUTPUT:
# foo invoked
# undefined
# [ERROR] Generator is already running

可以看到，差异有二：

next() 方法没有返回值；生成函数常与 co() 模块配合使用（本例中没有体现），此时就会出现报错：
TypeError: Iterator result undefined is not an object

溢出执行 next() 方法会导出错误，即：
Generator is already running


对于借助生成函数编写同步风格程序的设计来说，这种差异具有相当的破坏性。
版本比对
我们对比了一下 Node.js 版本：



Version
--harmony
测试结果




*
closed
normal


6.4.0
open
normal


^6.5.0
open
EXCEPTION


7.0.0
open
normal



也就是说，这个问题只有在 6.5.0（含）以上，7.0.0（不含）以下版本的和谐模式中，才会出现。
深入剖析
对比一下两个版本下 V8 引擎的 harmony 特性，不知是否可以发现端倪？
# Here -- tells command grep the next parameters are not options.
